import React, { Component } from 'react';

class Home extends Component {
    render() {
        return (
            <div>
                <h1>hello, my name is strauss,</h1>
                <h1>i'm a fullstack developer,</h1>
                <h1>and a design enthuiest. welcome to my page.</h1>

            </div>
        );
    }
}

export default Home;
